   V_MSQL VARCHAR(5000);
 
   V_ENTIDAD_ID NUMBER(16);
   
   V_TMP_CATALOGO1 T_CATALOGO1;
   --V_TMP_CATALOGO1_DEL T_CATALOGO1_DEL;

   err_num NUMBER;
   err_msg VARCHAR2(255);

-- Vble. para validar la existencia de los Registros.	
   reg_count number(3);

BEGIN


   DBMS_OUTPUT.PUT_LINE('Actualizando DD_CT1_CATALOGO_1......');

   FOR I IN V_TIPO_CATALOGO1.FIRST .. V_TIPO_CATALOGO1.LAST
   LOOP
 
-- Actualización y carga dd_ct1_catalogo1
    
        V_TMP_CATALOGO1 := V_TIPO_CATALOGO1(I);

        EXECUTE IMMEDIATE('SELECT COUNT(1) FROM '||V_ESQUEMA||'.DD_CT1_CATALOGO_1 
        WHERE DD_CT1_CODIGO = '''||V_TMP_CATALOGO1(1)||'''') INTO reg_count;
 
 	if reg_count = 0 then	

           V_MSQL := 'SELECT '||V_ESQUEMA||'.S_DD_CT1_CATALOGO_1.NEXTVAL FROM DUAL';
           EXECUTE IMMEDIATE V_MSQL INTO V_ENTIDAD_ID;

			DBMS_OUTPUT.PUT_LINE('Producto nuevo en catalogo1-INSERT: '||V_TMP_CATALOGO1(1));  

           V_MSQL := 'INSERT INTO '||V_ESQUEMA||'.DD_CT1_CATALOGO_1 
						(DD_CT1_ID,  DD_CT1_CODIGO,  DD_CT1_DESCRIPCION,  DD_CT1_DESCRIPCION_LARGA, VERSION, USUARIOCREAR, FECHACREAR, BORRADO)
               VALUES 
						('||  V_ENTIDAD_ID || ',''' || V_TMP_CATALOGO1(1) || ''','''||V_TMP_CATALOGO1(2)||''',''' ||V_TMP_CATALOGO1(3)||''',0,'''||V_USUARIO||''',SYSDATE,0)';
          
         
          EXECUTE IMMEDIATE V_MSQL;
           
            
      else 

            DBMS_OUTPUT.PUT_LINE('ACTUALIZANDO: '||V_TMP_CATALOGO1(1)||','||TRIM(V_TMP_CATALOGO1(2)));
 
            V_MSQL := 'UPDATE '||V_ESQUEMA||'.DD_CT1_CATALOGO_1
            SET 
				DD_CT1_DESCRIPCION = '''||V_TMP_CATALOGO1(2)||''', 
				DD_CT1_DESCRIPCION_LARGA = '''||V_TMP_CATALOGO1(3)||''', 
				USUARIOMODIFICAR = '''||V_USUARIO||''', 
				FECHAMODIFICAR = SYSDATE 
            WHERE DD_CT1_CODIGO = '''||V_TMP_CATALOGO1(1)||'''';   
            
           EXECUTE IMMEDIATE V_MSQL;
            

   	end if;	
   
   END LOOP; --LOOP Catalogo1 
   COMMIT;
  
    DBMS_OUTPUT.PUT_LINE('[INFO] EJECUCION TERMINADA CON EXITO');
   
EXCEPTION
     WHEN OTHERS THEN
 
          DBMS_OUTPUT.PUT_LINE('[ERROR] Se ha producido un error en la ejecucion: '|| TO_CHAR(SQLCODE) || ' ' || SQLERRM ); 

          err_num := SQLCODE;
          err_msg := SQLERRM;
          
          DBMS_OUTPUT.put_line('ERROR: '||TO_CHAR(err_num));
          DBMS_OUTPUT.put_line(err_msg);

         ROLLBACK;
         RAISE;
END;
